import React, { useState } from 'react';
import Post from './Post';
import Posts from './Post';


const PostList = ({ posts }) => {

    return (
        <div>
            {posts.map((post) => {
                return (
                    <>
                        <Post
                            title={post.title}
                            date={post.date}
                            body={post.body}
                        />
                    </>
                )
            })}
        </div>
    )
}

export default PostList;
